webpackJsonp([66851021271919],{922:function(e,t){e.exports={data:{markdownRemark:{html:'<p>如果你用一个<code class="gatsby-code-text">&lt;script&gt;</code>标签导入React, 所有的顶层API都能在<code class="gatsby-code-text">ReactDOM</code>的全局范围内被调用。 如果你用的是npm和ES6，你可以用<code class="gatsby-code-text">import ReactDOM from &#39;react-dom&#39;</code>。如果是npm和ES5，你可以用<code class="gatsby-code-text">var ReactDOM = require(&#39;react-dom&#39;)</code>。</p>\n<h2 id="总览"><a href="#%E6%80%BB%E8%A7%88" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>总览</h2>\n<p><code class="gatsby-code-text">react-dom</code>这个软件包提供了针对DOM的方法，可以在你应用的顶层调用，也可以在有需要的情况下用作到React模型外面的逃生出口。你的大部分组件都不应该需要使用这个包。</p>\n<ul>\n<li><a href="#render"><code class="gatsby-code-text">render()</code></a></li>\n<li><a href="#hydrate"><code class="gatsby-code-text">hydrate()</code></a></li>\n<li><a href="#unmountcomponentatnode"><code class="gatsby-code-text">unmountComponentAtNode()</code></a></li>\n<li><a href="#finddomnode"><code class="gatsby-code-text">findDOMNode()</code></a></li>\n<li><a href="#createportal"><code class="gatsby-code-text">createPortal()</code></a></li>\n</ul>\n<h3 id="浏览器支持"><a href="#%E6%B5%8F%E8%A7%88%E5%99%A8%E6%94%AF%E6%8C%81" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>浏览器支持</h3>\n<p>React支持所有常用的浏览器，包括IE9及以上的版本，although <a href="/docs/javascript-environment-requirements.html">some polyfills are required</a> for older browsers such as IE 9 and IE 10.</p>\n<blockquote>\n<p>注意</p>\n<p>我们不支持那些不兼容ES5方法的老版浏览器，但如果你的应用包含了polyfill，例如<a href="https://github.com/es-shims/es5-shim">es5-shim 和 es5-sham</a>，你可能会发现你的应用仍然可以在这些浏览器中正常运行。如果你选择这么干，你就只能孤军奋战了。</p>\n</blockquote>\n<hr>\n<h2 id="参考"><a href="#%E5%8F%82%E8%80%83" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>参考</h2>\n<h3 id="render"><a href="#render" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="gatsby-code-text">render()</code></h3>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-jsx"><code class="gatsby-code-jsx">ReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span>element<span class="token punctuation">,</span> container<span class="token punctuation">[</span><span class="token punctuation">,</span> callback<span class="token punctuation">]</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p>渲染一个React元素成为DOM，放到所提供的<code class="gatsby-code-text">container</code>里。并且返回这个组件的一个 <a href="/docs/more-about-refs.html">引用</a> (或者对于<a href="/docs/components-and-props.html#functional-and-class-components">无状态组件</a>返回<code class="gatsby-code-text">null</code>)。</p>\n<p>如果这个React元素在前一次已经被渲染成<code class="gatsby-code-text">container</code>，这将会为其执行一次更新，并且只会按需改变DOM，以反射最新的React元素。</p>\n<p>如果可选的回调函数被提供，回调将在组件被渲染或更新之后执行。</p>\n<blockquote>\n<p>注意:</p>\n<p><code class="gatsby-code-text">ReactDOM.render()</code> 控制你传进容器节点里的内容。当第一次被调用时，内部存在的任何DOM元素都会被替换掉。之后的调用会使用React的DOM差分算法进行高效的更新。</p>\n<p><code class="gatsby-code-text">ReactDOM.render()</code>不会修改容器节点（只修改容器的子代们）。你可以在不覆盖已有子节点的情况下添加一个组件到已有的DOM节点中去。</p>\n<p><code class="gatsby-code-text">ReactDOM.render()</code> 目前会返回一个引用， 指向 <code class="gatsby-code-text">ReactComponent</code>的根实例。但是这个返回值是历史遗留的，应该避免使用。因为未来版本的React可能会在某些情况下进行异步渲染。如果你真的需要一个指向 <code class="gatsby-code-text">ReactComponent</code> 的根实例的引用，推荐的方法是添加一个 <a href="/docs/more-about-refs.html#the-ref-callback-attribute">callback ref</a>到根元素上。</p>\n<p>Using <code class="gatsby-code-text">ReactDOM.render()</code> to hydrate a server-rendered container is deprecated and will be removed in React 17. Use <a href="#hydrate"><code class="gatsby-code-text">hydrate()</code></a> instead.</p>\n</blockquote>\n<hr>\n<h3 id="hydrate"><a href="#hydrate" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="gatsby-code-text">hydrate()</code></h3>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-jsx"><code class="gatsby-code-jsx">ReactDOM<span class="token punctuation">.</span><span class="token function">hydrate</span><span class="token punctuation">(</span>element<span class="token punctuation">,</span> container<span class="token punctuation">[</span><span class="token punctuation">,</span> callback<span class="token punctuation">]</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p>Same as <a href="#render"><code class="gatsby-code-text">render()</code></a>, but is used to hydrate a container whose HTML contents were rendered by <a href="/docs/react-dom-server.html"><code class="gatsby-code-text">ReactDOMServer</code></a>. React will attempt to attach event listeners to the existing markup.</p>\n<p>React expects that the rendered content is identical between the server and the client. It can patch up differences in text content, but you should treat mismatches as bugs and fix them. In development mode, React warns about mismatches during hydration. There are no guarantees that attribute differences will be patched up in case of mismatches. This is important for performance reasons because in most apps, mismatches are rare, and so validating all markup would be prohibitively expensive.</p>\n<p>If a single element’s attribute or text content is unavoidably different between the server and the client (for example, a timestamp), you may silence the warning by adding <code class="gatsby-code-text">suppressHydrationWarning={true}</code> to the element. It only works one level deep, and is intended to be an escape hatch. Don’t overuse it. Unless it’s text content, React still won’t attempt to patch it up, so it may remain inconsistent until future updates.</p>\n<p>If you intentionally need to render something different on the server and the client, you can do a two-pass rendering. Components that render something different on the client can read a state variable like <code class="gatsby-code-text">this.state.isClient</code>, which you can set to <code class="gatsby-code-text">true</code> in <code class="gatsby-code-text">componentDidMount()</code>. This way the initial render pass will render the same content as the server, avoiding mismatches, but an additional pass will happen synchronously right after hydration. Note that this approach will make your components slower because they have to render twice, so use it with caution.</p>\n<p>Remember to be mindful of user experience on slow connections. The JavaScript code may load significantly later than the initial HTML render, so if you render something different in the client-only pass, the transition can be jarring. However, if executed well, it may be beneficial to render a “shell” of the application on the server, and only show some of the extra widgets on the client. To learn how to do this without getting the markup mismatch issues, refer to the explanation in the previous paragraph.</p>\n<hr>\n<h3 id="unmountcomponentatnode"><a href="#unmountcomponentatnode" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="gatsby-code-text">unmountComponentAtNode()</code></h3>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-jsx"><code class="gatsby-code-jsx">ReactDOM<span class="token punctuation">.</span><span class="token function">unmountComponentAtNode</span><span class="token punctuation">(</span>container<span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p>从DOM元素中移除已挂载的React组件，清除它的事件处理器和state。如果容器内没有挂载任何组件，这个函数什么都不会干。\n有组件被卸载的时候返回<code class="gatsby-code-text">true</code>，没有组件可供卸载时返回 <code class="gatsby-code-text">false</code>。</p>\n<hr>\n<h3 id="finddomnode"><a href="#finddomnode" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="gatsby-code-text">findDOMNode()</code></h3>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-jsx"><code class="gatsby-code-jsx">ReactDOM<span class="token punctuation">.</span><span class="token function">findDOMNode</span><span class="token punctuation">(</span>component<span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p>如果这个组件已经被挂载到DOM中，函数会返回对应的浏览器中生成的DOM元素 。\n当你需要从DOM中读取值时，比如表单的值，或者计算DOM元素的尺寸，这个函数会非常有用。\n<strong>大多数情况下，你可以添加一个指向DOM节点的引用，从而完全避免使用<code class="gatsby-code-text">findDOMNode</code> 这个函数.</strong> 当 <code class="gatsby-code-text">render</code> 返回 <code class="gatsby-code-text">null</code> 或者 <code class="gatsby-code-text">false</code> 时, <code class="gatsby-code-text">findDOMNode</code> 也返回 <code class="gatsby-code-text">null</code>.</p>\n<blockquote>\n<p>注意:</p>\n<p><code class="gatsby-code-text">findDOMNode</code> 是用于操作底层DOM节点的备用方案。在大部分情况下都不提倡使用这个方案，因为它破坏了组件的抽象化。</p>\n<p><code class="gatsby-code-text">findDOMNode</code> 只对挂载过的组件有效（也就是已经添加到DOM中去的组件）。如果你试图对一个未挂载的组件调用这个函数\n（比如在一个还未创建的组件的 <code class="gatsby-code-text">render()</code> 函数中中调用 <code class="gatsby-code-text">findDOMNode()</code>），程序会抛出一个异常。</p>\n<p><code class="gatsby-code-text">findDOMNode</code> 不能用于函数式的组件中。</p>\n</blockquote>\n<hr>\n<h3 id="createportal"><a href="#createportal" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="gatsby-code-text">createPortal()</code></h3>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-jsx"><code class="gatsby-code-jsx">ReactDOM<span class="token punctuation">.</span><span class="token function">createPortal</span><span class="token punctuation">(</span>child<span class="token punctuation">,</span> container<span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p>Creates a portal. Portals provide a way to <a href="/docs/portals.html">render children into a DOM node that exists outside the hierarchy of the DOM component</a>.</p>',frontmatter:{title:"ReactDOM",next:null,prev:null},fields:{path:"docs/reference-react-dom.md",slug:"docs/react-dom.html"}}},pathContext:{slug:"docs/react-dom.html"}}}});
//# sourceMappingURL=path---docs-react-dom-html-c6c2e2ac8cd91c618ca9.js.map